import React from "react";

const AddUser = (props) => {
  return (
    <div>
      <form>
        <label for="name">Name</label>
        <input type="text" id="name"></input>
        <label for="age">Age</label>
        <input type="number" id="age"></input>
      </form>
    </div>
  );
};

export default AddUser;
